import Link from 'next/link';

const linkStyle = {
    marginRight: 15
};

const Header = () => {
    return (
        <div>
            <p>Hello Next.js</p>
            <Link href="/about" title="About Page">
                <a title="about">关于我</a>
            </Link>
            <Link href="/joinUs">
                <a title="join us">加入我们</a>
            </Link>
        </div>
    )
};

export default Header;
